import RequestItem from "./RequestItem";

const requests = [
  {
    user: "John Doe",
    id: "01",
    song: "All the lights - Kanye West",
    time: "8:23 Min",
    price: "MZN 45.5",
    image: "image-url-1",
    status: "approved",
  },
  {
    user: "Ana Doe",
    id: "06",
    song: "ASTROTHUNDER - Travis Scott",
    time: "4:03 Min",
    price: "MZN 56.5",
    image: "image-url-2",
    status: "approved",
  },
  {
    user: "Ana Doe",
    id: "06",
    song: "Flashing Lights - Kanye West",
    time: "8:23 Min",
    price: "MZN 45.5",
    image: "image-url-1",
    status: "denied",
  },
];

const RequestList = () => {
  return (
    <div className="request-list">
      {requests.map((request, index) => (
        <RequestItem key={index} request={request} />
      ))}
      <div className="view-more">Ver Mais </div>
    </div>
  );
};

export default RequestList;
